# Creación de gráficos con `ggplot2`

---

background-image: url("img/grammar.png")
background-size: contain

---

## Gramática de los gráficos

- **Data:** datos sin procesar que desea trazar.
- **Geometrías `geom_:`** formas geométricas que representarán los datos.
- **Estética `aes()`:** estética de los objetos geométricos y estadísticos, como posición, color, tamaño, forma y transparencia.
- **Escalas `scale_`:** asignaciones entre los datos y las dimensiones estéticas, como el rango de datos para trazar el ancho o los valores de los factores para los colores.
- **Transformaciones estadísticas `stat_`:** resúmenes estadísticos de los datos, como cuantiles, curvas ajustadas y sumas.
- **Sistema de coordenadas `coord_`:** transformación utilizada para mapear coordenadas de datos en el plano del rectángulo de datos.
- **Facetas `facet_`:** disposición de los datos en una cuadrícula de gráficos.
- **Temas visuales `theme()`:** los valores predeterminados visuales generales de una trama, como el fondo, las cuadrículas, los ejes, el tipo de letra predeterminado, los tamaños y los colores.

&lt;br&gt;

## Data

.pull-left[
Un **ggplot** necesita especificar mínimo tres cosas: los datos, la estética y una geometría. 

Siempre comenzamos a definir un objeto de trazado llamando a la **data** mediante `data %&gt;% ggplot()` que simplemente le dice a `ggplot2` que vamos a trabajar con esos datos.

Primero, cargamos el paquete `ggplot2` que es parte del `tidyverse`.


```r
library(ggplot2)
```


```r
ventas %&gt;% ggplot()
```
]

.pull-right[
![](4_EDA_files/figure-html/graf3-1.png)&lt;!-- --&gt;
]

---

## Estética

**Aesthetics** significa describir un objeto en nuestros gráficos. Sin estética no tenemos nada que mostrar en nuestros gráficos.

Las variables del conjunto de datos se asignan a propiedades visuales de gráficos con **aesthetics mapping**.

Depende del tipo de gráfico estadístico que estemos produciendo, pero generalmente mapeamos:
   * una variable que se mostrará en el eje `\(x\)`
   * una variable que se mostrará en el eje `\(y\)` (en algunos casos solo necesitamos mapear a un solo eje)
   * se pueden asignar otras variables al color, la forma, el tamaño, el color de relleno, etc. del objeto.


---

background-image: url("img/aesthetics.png")
background-size: contain

---

## Estética

.pull-left[

En la mayoría de los casos, es posible que desee trazar una o dos variables: una en el eje `\(x\)` y otra en el eje `\(y\)`. Estas son estéticas posicionales y, por lo tanto, agregamos `aes(x = var1, y = var2)` a la llamada **ggplot()**.

Sin embargo, también hay casos en los que hay que especificar una o incluso tres o más variables.


```r
ventas %&gt;% ggplot(aes(x=TOTAL_VENTAS, 
                      y=TOTAL_COMPRAS))
```
]

.pull-right[
![](4_EDA_files/figure-html/graf5-1.png)&lt;!-- --&gt;
]

---

## Geometrías

.pull-left[
Hay muchas geometrías diferentes (llamadas **geoms** porque cada función generalmente comienza con `geom_`) que se pueden agregar a un ggplot de forma predeterminada.

Tenemos que decirle a `ggplot2` qué estilo queremos usar, por ejemplo, agregando `geom_point()` para crear un gráfico de puntos o gráfico de dispersión.


```r
ventas %&gt;% ggplot(aes(x=TOTAL_VENTAS, 
                      y=TOTAL_COMPRAS)) +
    geom_point()
```
]

.pull-right[
![](4_EDA_files/figure-html/graf7-1.png)&lt;!-- --&gt;
]

## Facetas

Las facetas dividen un conjunto en subconjuntos basados en los valores de uno o más variables categóricas.

* **Facet** es un objeto que crea muchos gráficos pequeños que son variaciones de un solo gráfico. 

* Los datos se dividen en **grupos** (facetas) y los datos se trazan en sus propios gráficos usando el mismo sistema de coordenadas.

* Tenemos dos opciones al generar facetas:
   * Gráfico dividido según filas y columnas: `facet_grid()`
   * Envolver subconjuntos en columnas: `facet_wrap()` 

---

background-image: url("img/facet.png")
background-size: contain

## Transformaciones estadísticas

**Stats** son métodos que alteran la posición de las geometrías. Podemos representar más de una estadística en una figura.

La capa de **Stats** representa una forma alternativa de crear una capa, ya que es una transformación del conjunto de datos original.

Con las estadísticas, creamos variables adicionales (transformadas) para mapear la estética.

Los métodos estadísticos más importantes disponibles para los gráficos se dividen en cinco clases:
   * **bin** (particiones y mallas - para histogramas)
   * **summary** (estadísticas básicas: media, mediana, desviación, …)
   * **region** (límites de intervalo y región)
   * **smooth** (regresión, smoothing, interpolación y estimación de densidad)
   * **link** (métodos para calcular bordes de gráficos basados en un conjunto de nodos o puntos)

---

## Transformaciones estadísticas

Hay docenas de capas de **Stats** especificadas con un `stat_function`. La mayoría de los geoms y las estadísticas vienen en pares que casi siempre se usan en conjunto. La siguiente tabla contiene los pares entre geometrías y estadísticos que se usan en conjunto.

.pull-left[
| geometría           | estadístico         |
|---------------------|---------------------|
| `geom_bar()`        | `stat_count()`      |
| `geom_point()`      | `stat_identity()`, `stat_sum()`   |
| `geom_line()`       | `stat_identity()`   |
| `geom_bin2d()`      | `stat_bin_2d()`     |
| `geom_boxplot()`    | `stat_boxplot()`    |
| `geom_contour()`    | `stat_contour()`    |
| `geom_count()`      | `stat_sum()`        |
| `geom_density()`    | `stat_density()`    |
| `geom_density_2d()` | `stat_density_2d()` |
]

.pull-right[
| geometría           | estadístico         |
|---------------------|---------------------|
| `geom_hex()`        | `stat_hex()`        |
| `geom_freqpoly()`   | `stat_bin()`        |
| `geom_histogram()`  | `stat_bin()`        |
| `geom_qq_line()`    | `stat_qq_line()`    |
| `geom_qq()`         | `stat_qq()`         |
| `geom_quantile()`   | `stat_quantile()`   |
| `geom_smooth()`     | `stat_smooth()`     |
| `geom_violin()`     | `stat_violin()`     |
| `geom_sf()`         | `stat_sf()`         |
]

## Coordenadas y Escalas

Son conjuntos que ubican puntos en el espacio. Generalmente, vemos las coordenadas como esquemas para mapear elementos de conjuntos para objetos geométricos.

Las coordenadas más conocidas son las **coordenadas cartesianas**, donde el punto es ubicado en un plano cartesiano por su distancia a dos rectas que se cortan.

Hay diferentes **sistemas de coordenadas**. ¿Por qué usar diferentes sistemas? Una razón es simplificar la visualización de gráficos.

Las transformaciones de coordenadas pueden cambiar algunos gráficos curvilíneos a lineales. ggplot2 proporciona diferentes sistemas de coordenadas.

# Análisis exploratorio de datos

---

## Análisis exploratorio de datos

El análisis exploratorio es un enfoque en el que se "deja hablar a los datos" para que ellos nos den las pistas necesarias para construir modelos o incluso desarrollar supuestos o conclusiones.

Conocer los datos "como a la palma de tu mano", este es el primer beneficio del EDA, algo útil seas analista comercial, de marketing, científico, ingeniero o cualquier puesto donde analizar datos sea fundamental.

Por conocer, nos referimos a: Comprende las correlaciones entre los elementos, descubrir la estructura subyacente de los datos, detectar valores atípicos y anomalías, etc.

Por "dejar a los datos hablar" nos referimos a permitir que los datos sugieran los modelos que se adaptan mejor a ellos datos, encontrar variables importantes o más relacionadas, desarrollar modelos parsimoniosos, etc.

---

## Análisis exploratorio de datos

- Permite entender los datos

- Sirve para examinar las variables y sus interacciones antes de aplicar las técnicas

- Es util para encontrar errores en el set de datos 

- Se realiza mediante estadísticos descriptivos y principalmente gráficos

- Suele ser un proceso iterativo:
   - se plantea una pregunta 
   - se grafica o se crea una tabla para responder
   - se obtiene una idea o una nueva pregunta del paso anterior
   - Proporciona pistas o intuición

## Variables numéricas

.pull-left[

### Histograma de frecuencias

Para explorar variables continuas graficaremos un histograma de frecuencias con `geom_histogram()`.


```r
ventas %&gt;%
    filter(VN_tar12&gt;2500 &amp; VN_tar12&lt;20000) %&gt;%
    ggplot(aes(x=VN_tar12)) +
    geom_histogram(binwidth = 2500,
                   color = "black", fill = "chartreuse4") +
    scale_x_continuous(breaks = seq(0, 20000, 2500)) +
    scale_y_continuous(breaks = seq(0, 800, 100)) +
    labs(x = "Ventas con tarifa 12% (USD)",
         y = "Frecuencia",
         title = "Ventas con tarifa 12% - Histograma") +
    theme(text = element_text(colour = "grey45", size = 10),
          plot.title = element_text(face = "bold", size = 14,
                                    colour = "grey30"),
          plot.background = element_rect(fill = "grey92"),
          panel.grid.minor = element_blank()) +
    coord_flip()
```

]

## Variables categóricas

.pull-left[
### Gráfico de cascada

Un gráfico en cascada, también denominado gráfico puente, es un tipo especial de gráfico de columnas que le ayuda a identificar cómo un valor inicial se ve afectado por un aumento y una disminución de los datos intermedios, lo que lleva a un valor final.


```r
library(waterfalls)

ventas %&gt;% 
    filter(EXPORTACIONES&gt;5000000) %&gt;% 
    group_by(provincia) %&gt;% 
    summarise(Frec = n()) %&gt;% 
    arrange(-Frec) %&gt;% 
    mutate(Prop= round((Frec/ sum(Frec))*100,2),
           PosLab= cumsum(Prop) - 0.6*Prop) %&gt;%
    select(provincia, Prop) %&gt;%
    waterfall(values = Prop, calc_total = TRUE) 
```

## Varias Variables numéricas

.pull-left[
### Gráfico de dispersión

El gráfico de dispersión se usa para averiguar la intensidad de la relación entre dos variables numéricas. El eje `\(X\)` representa la variable independiente, mientras que el eje `\(Y\)` representa la variable dependiente. En R lo generamos con `geom_point()`.


```r
# gráfico de dispersión simple
ventas %&gt;% 
    filter(provincia=="PICHINCHA" |
                    provincia=="GUAYAS" |
                    provincia=="AZUAY") %&gt;% 
    ggplot(aes(x = TOTAL_VENTAS, 
               y = TOTAL_COMPRAS)) +

### Histograma

```r
## Transparencia de histogramas
ventas %&gt;% 
    filter(VN_tar12&gt;2500 &amp; VN_tar12&lt;20000) %&gt;% 
    ggplot(aes(x = VN_tar12)) +
    geom_histogram(aes(fill = region),
                   position = "identity",
                   alpha = 0.5) +
    labs(x = "Ventas con tarifa 12% (USD)",
         y = "Frecuencia",
         title = "Ventas con tarifa 12% - Histograma",
         fill = "Region") +
    tema_nuevo
```

## Variables numéricas con una categórica

.pull-left[
### Gráfico de densidad

Un gráfico de densidad visualiza la distribución de datos cuantitativos en un intervalo o período de tiempo continuo. Este gráfico es una variación de un histograma que usa suavizado de kernel para trazar valores, lo que permite distribuciones más suaves suavizando el ruido. En R lo generamos con `geom_density()`:



```r
## gráfico de densidad con transparencia
ventas %&gt;% 
    filter(VN_tar12&gt;2500 &amp; VN_tar12&lt;20000) %&gt;% 
    ggplot(aes(x = VN_tar12, fill = region)) +
    geom_density(alpha = 0.5) +
    labs(x = "Ventas con tarifa 12% (USD)",
         y = "Densidad",
         title = "Ventas con tarifa 12% - Densidad",
         fill = "Region") +
    tema_nuevo
```

]

.pull-right[
![](4_EDA_files/figure-html/vvn27-1.png)&lt;!-- --&gt;
]

---

## Variables numéricas con una categórica

.pull-left[
### Gráfico de líneas verticales

Podemos agregar estadísticos al gráfico de densidad mediante un gráfico de líneas verticales con `geom_vline()`:


```r
## calculando estadísticos para el gráfico
ventas_medias &lt;- ventas %&gt;%
    filter(VN_tar12&gt;2500 &amp; VN_tar12&lt;20000) %&gt;% 
    group_by(region) %&gt;%
    summarise(MEDIA = mean(VN_tar12, na.rm= TRUE))

## agregamos geom_vline()
ventas %&gt;% 
    filter(VN_tar12&gt;2500 &amp; VN_tar12&lt;20000) %&gt;% 
    ggplot(aes(x = VN_tar12, fill = region)) +
    geom_density(alpha = 0.5) +
    geom_vline(data = ventas_medias, 
               aes(xintercept = MEDIA, colour= region), 
               linetype= "dashed", size= 1) +
    labs(x = "Ventas con tarifa 12% (USD)",
         y = "Densidad",
         title = "Ventas con tarifa 12% - Densidad",
         fill = "Region") +
    tema_nuevo
```

]

![](4_EDA_files/figure-html/vvn29-1.png)&lt;!-- --&gt;
]

## Variables numéricas con una categórica

.pull-left[
### Gráfico de texto

Podemos agregar estadísticos al gráfico de densidad y de líneas verticales con `geom_text()`:


```r
## incluir los valores de medias en texto con geom_text()
ventas %&gt;% 
    filter(VN_tar12&gt;2500 &amp; VN_tar12&lt;20000) %&gt;% 
    ggplot(aes(x = VN_tar12, fill = region)) +
    geom_density(alpha = 0.5, lwd = 0.2) +
    geom_vline(data = ventas_medias, 
               aes(xintercept = MEDIA, colour= region), 
               linetype= "dashed", size= 1) +
    geom_text(data = ventas_medias,
              aes(x=MEDIA - 150, label= paste("Media: USD ", round(MEDIA,2)), y=0.00009, colour= region),
              angle=90) +
    labs(x = "Ventas con tarifa 12% (USD)",
         y = "Densidad",
         title = "Ventas con tarifa 12% - Densidad",
         fill = "Region") +
    tema_nuevo
```

]

El diagrama de violín grafica la concentración de las observaciones con `geom_violin()`:


```r
## gráfico de violín

    ggplot(aes(x = region, y = VN_tar12)) +
    geom_violin(aes(fill = region, color = region), alpha = 0.5) +
    coord_flip() +
    labs(x = "Region",
         y = "Ventas con tarifa 12% (USD)",
         title = "Ventas con tarifa 12%") +

## Variables numéricas con una categórica

### Gráfico de cajas

Podemos conseguir información más útil agregando un gráfico de cajas con `geom_boxplot` al gráfico de violin anterior:


```r
## gráfico de cajas sin outliers
ventas %&gt;% 
    filter(VN_tar12&gt;2500 &amp; VN_tar12&lt;20000) %&gt;%
    ggplot(aes(x = region, y = VN_tar12)) +
    geom_violin(aes(fill = region, color = region), alpha = 0.5) +
    geom_boxplot( aes(fill = region), color= "#5B5B5B", width=.2, outlier.colour=NA) +
    coord_flip() +
    labs(x = " ",
         y = "Ventas con tarifa 12% (USD)",
         title = "Ventas con tarifa 12%") +
    tema_nuevo
```

```r
## agregar capa estadística

          panel.grid.minor = element_blank())

ggplotly(g2)

## Gráficos html

.pull-left[

```r
## gráfico dinámico de un gráfico de cajas
g3 &lt;- ventas %&gt;% 
    filter(VN_tar12&gt;2500 &amp; VN_tar12&lt;20000) %&gt;%
    ggplot(aes(x = region, y = VN_tar12)) +
    geom_violin(aes(fill = region, color = region), alpha = 0.5) +
    geom_boxplot( aes(fill = region), color= "#5B5B5B", width=.2, outlier.colour=NA) +
    coord_flip() +
    labs(x = " ",
         y = "Ventas con tarifa 12% (USD)",
         title = "Ventas con tarifa 12%") +
    tema_nuevo

ggplotly(g3)
```

    group_by(mes, provincia) %&gt;% 
    summarise(Frec = n()) %&gt;% 
    ggplot(aes(x = provincia, y = Frec)) +
    geom_point(size = 5, color = "chartreuse4") +
    geom_segment(aes(xend = provincia, y = 0, yend = Frec),
                 color = "chartreuse4", size = 1) +
    labs(x = "Provincias", y = "Frecuencia",
         title = "Cantidad de transacciones globales por provincia",
         subtitle = "Mes: {current_frame}") + 
    theme(text = element_text(colour = "grey45", size = 10),
          plot.title = element_text(face = "bold",
                                    size = 14, colour = "grey30"),
          plot.background = element_rect(fill = "grey92"),
          panel.grid.minor = element_blank(),
          axis.text.x = element_text(angle = 90, size = 7)) +
    transition_manual(mes)                            

animate(anime, renderer = gifski_renderer())
